// App.js
import React, { useState } from 'react';
import * as math from 'mathjs';
import ConfettiExplosion from 'react-confetti-explosion';

const App = () => {
  const [expression, setExpression] = useState('');
  const [isExploding, setIsExploding] = useState(false);

  const handleClick = (value) => {
    setExpression((prev) => prev + value);
  };

  const handleClear = () => {
    setExpression('');
  };

  const handleCalculate = () => {
    try {
      if (expression.includes('5') && expression.includes('6')) {
        setIsExploding(true);
        setTimeout(() => setIsExploding(false), 2000); // Stop explosion after 2 seconds
      }
      setExpression(math.evaluate(expression).toString());
    } catch (error) {
      setExpression('Error');
    }
  };

  const handleSpecialFunction = (func) => {
    try {
      setExpression((prev) => math[func](math.evaluate(prev)).toString());
    } catch (error) {
      setExpression('Error');
    }
  };

  const handleFactorial = () => {
    try {
      setExpression((prev) => math.factorial(math.evaluate(prev)).toString());
    } catch (error) {
      setExpression('Error');
    }
  };

  const handleRandom = () => {
    setExpression(Math.random().toString());
  };

  const handleChangeSign = () => {
    try {
      setExpression((prev) => {
        if (prev) {
          const evaluated = math.evaluate(prev);
          return (evaluated * -1).toString();
        }
        return prev;
      });
    } catch (error) {
      setExpression('Error');
    }
  };

  return (
    <div className="calculator">
      {isExploding && <ConfettiExplosion />}
      <input type="text" value={expression} readOnly />
      <div className="buttons">
        <button onClick={() => handleClick('1')}>1</button>
        <button onClick={() => handleClick('2')}>2</button>
        <button onClick={() => handleClick('3')}>3</button>
        <button onClick={() => handleClick('+')}>+</button>
        <button onClick={() => handleClick('4')}>4</button>
        <button onClick={() => handleClick('5')}>5</button>
        <button onClick={() => handleClick('6')}>6</button>
        <button onClick={() => handleClick('-')}>-</button>
        <button onClick={() => handleClick('7')}>7</button>
        <button onClick={() => handleClick('8')}>8</button>
        <button onClick={() => handleClick('9')}>9</button>
        <button onClick={() => handleClick('*')}>*</button>
        <button onClick={() => handleClick('0')}>0</button>
        <button onClick={() => handleClick('.')}>.</button>
        <button onClick={() => handleClick('/')}>/</button>
        <button onClick={handleCalculate}>=</button>
        <button onClick={handleClear}>C</button>
        <button onClick={() => handleSpecialFunction('sqrt')}>√</button>
        <button onClick={() => handleSpecialFunction('log')}>log</button>
        <button onClick={() => handleSpecialFunction('exp')}>exp</button>
        <button onClick={() => handleSpecialFunction('sin')}>sin</button>
        <button onClick={() => handleSpecialFunction('cos')}>cos</button>
        <button onClick={() => handleSpecialFunction('tan')}>tan</button>
        <button onClick={handleFactorial}>!</button>
        <button onClick={handleRandom}>rand</button>
        <button onClick={handleChangeSign}>±</button>
      </div>
    </div>
  );
};

export default App;
